import React from 'react';
import PropTypes from 'prop-types';

import InfoWindow from './InfoWindow';

export default function MobileInfoWindow({children}) {
  return (
    <div className="mobileInfoWindow">
      <InfoWindow>
        {children}        
      </InfoWindow>
    </div>
  );
}

MobileInfoWindow.propTypes = {
  children: PropTypes.node.isRequired,
};
